import React from 'react';

const PatientProfile = () => {
  return (
    <div className="patient-profile">
      <div className="container">
        <h1>My Profile</h1>
        <p>Patient profile management coming soon...</p>
      </div>
    </div>
  );
};

export default PatientProfile;
